  @Test
  public void testMemberMsgTemplate() throws Exception{
    String str = memberSmsTemplate;
    VelocityEngine ve = new VelocityEngine();
    ve.setProperty(VelocityEngine.RESOURCE_LOADER, "string");
    ve.setProperty("string.resource.loader.class", "org.apache.velocity.runtime.resource.loader.StringResourceLoader");
    ve.init();
    //创建资源库
    StringResourceRepository repo = StringResourceLoader.getRepository();
    String myTemplateName = "memberSmsMsg";

    String myTemplate = str;

    //模板资源存放 资源库 中
    repo.putStringResource(myTemplateName, myTemplate);

    //从资源库中加载模板
    Template template = ve.getTemplate(myTemplateName);

    //取得velocity的模版
    Template t = ve.getTemplate(myTemplateName, "UTF-8");
    //取得velocity的上下文context
    VelocityContext context = new VelocityContext();
    //把数据填入上下文
//    context.put("licenceNo", "苏E32834");
    context.put("cardOwnerName", "王老五");
    context.put("consumeDate", "8月30日");
    Map<String, String> consumeItems = new LinkedHashMap<String, String>();
    consumeItems.put("洗车", "1");
    consumeItems.put("打蜡", "1");
    context.put("consumeItems", consumeItems);
    context.put("consumeAmount", 30);
    Map<String, String> remainItems = new LinkedHashMap<String, String>();
    remainItems.put("洗车", "10");
    remainItems.put("打蜡", "5");
    remainItems.put("充气", "无限");
    context.put("remainItems", remainItems);
    context.put("remainAmount", 300);

    //输出流
    StringWriter writer = new StringWriter();

    //转换输出
    t.merge(context, writer);
    System.out.println(writer.toString());
    System.out.println(writer.toString().length());
  }

